import { Box, Container, Grid } from "@mui/material"
import TopBar from "components/app_bar/top_bar";
import { SnackbarProvider } from 'notistack'
import HeaderSection from "./components/header_section";
import IntroSection from "./components/intro_section";


const Overview = () => {
  return (
    <Container
    sx={{paddingLeft: "20px", paddingRight: "20px"}}
      maxWidth="lg">
      <Box
        display={{ xs: "none", sm: "block" }}
        sx={{
          position: "absolute",
          top: 0,
          aspectRatio: 1,
          right: 0
        }}>
        <img src="img/top_right_anchor.svg" style={{
          maxWidth: "60vw",
          objectFit: "contain"
        }} />
      </Box>
      <Box
        display={{ xs: "none", sm: "block" }}
        sx={{
          opacity: 0.6,
          position: "absolute",
          top: 0,
          left: 0
        }}>
        <img src="img/top_left_anchor.svg"
          style={{
            maxWidth: "100vw",
            objectFit: "contain"
          }}
        />
      </Box>

      <TopBar />
      <Grid container position="relative" zIndex={10}>

          <HeaderSection/>
          <IntroSection/>

      </Grid>

    </Container>
  )
}

export default function IntegrationNotistack() {
  return (
    <SnackbarProvider maxSnack={3}>
      <Overview />
    </SnackbarProvider>
  );
}
